import React, { Component } from 'react';
import Bootstrap, {
    Navbar,
  } from 'bootstrap-4-react';

const AppBar = () => {
    const Menu = props => (
        <Navbar id="navBar" expand="md" dark fixed="dow" bg="secondary">
          <Navbar.Brand href="#"><h2 id="Ide">Wdemy</h2></Navbar.Brand>

        </Navbar>
      )
    return (
        <>
           <div>
               <Menu />
           </div>
        </>
    )
}

export default AppBar
